import React from 'react';

const webUrl = `${window.location.origin.toString()}`;

function ClientCard({img, txt, txt1}) {
    return (
        <li>
            <div class="clientSec-card">
                <div class="clientSec-img">
                    <img src={webUrl+img} alt=""/>
                </div>

                <p>
                    {txt}
                </p>

                <span>{txt1}</span>
            </div>
        </li>
    )
}

export default ClientCard
